import React, {useState} from 'react'
import {
    Button,
    Table,
    TableHead,
    TableBody,
    TableRow,
    TableCell,
    Container,
    MenuItem,
    Menu
} from '@mui/material'
import MoreVertIcon from '@mui/icons-material/MoreVert'
import PopupState, { bindTrigger, bindMenu } from 'material-ui-popup-state';
import DeleteIcon from '@mui/icons-material/Delete'


const Import = (props) => {
    // fill out this component
    // console.log(props)
    // const [anchorEl, setAnchorEl] = React.useState(null);

    // const handleClick = (event) => {
    //     setAnchorEl(event.currentTarget);
    // }
    // const handleClose = () => {
    //     setAnchorEl(null);
    //   };
    // const [deletedMakes] = useState(null);

    // const handleDeletes = (index) => {
    //     props.deleteMake(deletedMakes, index)
    //     setAnchorEl(null);
    // }

    return (
        <Container>
        <Button
            variant="contained"
            color="primary"
            onClick={props.fetchMakes}>Import</Button>
            
            {/* <h2> Count: {props.makes.length}</h2> */}
            <Table>
            <TableHead>
                <TableRow>
                    <TableCell>Id</TableCell>
                    <TableCell>Make</TableCell>
                    <TableCell>Actions</TableCell>
                </TableRow>
            </TableHead>
            <TableBody>
            {props.makes.map((makes, index) => (
                    <TableRow key={index}>
                        <TableCell>{makes.MakeId}</TableCell>
                        <TableCell>{makes.MakeName}</TableCell>
                        <TableCell>
                            {/* <MoreVertIcon onClick={handleClick} />
                         
                            <Menu
                                    id="simple-menu"
                                    anchorEl={anchorEl}
                                    keepMounted
                                    open={Boolean(anchorEl)}
                                    onClose={handleClose}
                                >
                                    <DeleteIcon onClick={handleDeletes}>DELETE</DeleteIcon>
                                    <MenuItem onClick={handleClose}>Close</MenuItem>
                                </Menu> */}
                            {/* <DeleteIcon onClick={() => props.deleteMakes(index)}
                                className="icon text-red" /> */}
                            {/* {console.log(index)} */}
                            <PopupState variant="popover" popupId="demo-popup-menu">
      {(popupState) => (
        <React.Fragment>
          <Button variant="contained" {...bindTrigger(popupState)}>
            Dashboard
          </Button>
          <Menu {...bindMenu(popupState)}>
            <MenuItem onClick={popupState.close}>Profile</MenuItem>
            <MenuItem onClick={popupState.close}>My account</MenuItem>
            <MenuItem onClick={popupState.close}>Logout</MenuItem>
          </Menu>
        </React.Fragment>
      )}
    </PopupState>





                         </TableCell>   
                    </TableRow>
            ))}
            </TableBody>
        </Table>
    
    </Container>
        
    )
}

export default Import
